import Navigation from "../Navigation/Navigation";
import { Link } from "react-router-dom";
import "./Header.css";
import logoOne from "../../images/logo.png";

function Header({ isLogined }) {
  return (
    <section className={"header" + (isLogined ? " header_type_isLogined" : "")}>
      <div className="header">
        <Link to="/" className="auth-form__img-wrapper-link">
          <img className="header__logo" src={logoOne} alt="Логотип сайта" />
        </Link>
        <Navigation logined={isLogined} />
      </div>
    </section>
  );
}

export default Header;
